[
  {
    "name": "UBX-CFG-INF (Poll configuration for one protocol)",
    "class_id": "0x06",
    "message_id": "0x02",
    "message_type": "poll",
    "payload_length": {
      "fixed": 1
    },
    "fields": [
      {
        "byte_offset": 0,
        "data_type": "U1",
        "name": "protocolID",
        "description": "Protocol identifier, identifying the output protocol for this poll request. The following are valid protocol identifiers: 0: UBX protocol, 1: NMEA protocol, 2-255: Reserved"
      }
    ]
  },
  {
    "name": "UBX-CFG-INF (Information message configuration - Get/Set)",
    "class_id": "0x06",
    "message_id": "0x02",
    "message_type": "get_set",
    "payload_length": {
      "variable": {
        "block_size": 10
      }
    },
    "fields": [
      {
        "byte_offset": 0,
        "data_type": "U1",
        "name": "protocolID",
        "description": "Protocol identifier, identifying for which protocol the configuration is set/get. The following are valid protocol identifiers: 0: UBX protocol, 1: NMEA protocol, 2-255: Reserved"
      },
      {
        "byte_offset": 1,
        "data_type": {
          "array_of": "U1",
          "count": 3
        },
        "name": "reserved0",
        "reserved": true
      },
      {
        "byte_offset": 4,
        "data_type": {
          "array_of": "X1",
          "count": 6
        },
        "name": "infMsgMask",
        "description": "A bit mask, saying which information messages are enabled on each I/O port (one byte per port)",
        "bit_fields": [
          {
            "bit_offset": 0,
            "bit_length": 1,
            "name": "ERROR",
            "description": "enable ERROR"
          },
          {
            "bit_offset": 1,
            "bit_length": 1,
            "name": "WARNING",
            "description": "enable WARNING"
          },
          {
            "bit_offset": 2,
            "bit_length": 1,
            "name": "NOTICE",
            "description": "enable NOTICE"
          },
          {
            "bit_offset": 3,
            "bit_length": 1,
            "name": "TEST",
            "description": "enable TEST"
          },
          {
            "bit_offset": 4,
            "bit_length": 1,
            "name": "DEBUG",
            "description": "enable DEBUG"
          }
        ]
      }
    ]
  }
]
